import React from "react";
import { useParams } from "react-router-dom";

const CoinDetails = ({ coins }) => {
  const { coinId } = useParams();

  return (
    <>
      <div>CoinDetails: {coinId}</div>
    </>
  );
};

export default CoinDetails;
